CREATE TABLE syjzhpt.pcyzdszmain (
  pcyzdszmainid varchar(32) NOT NULL DEFAULT '' COMMENT 'id',
  tabname varchar(50) DEFAULT NULL COMMENT '表名',
  tabnamedesc varchar(200) DEFAULT NULL COMMENT '表描述',
  colname varchar(50) DEFAULT NULL COMMENT '列名',
  colnamedesc varchar(200) DEFAULT NULL COMMENT '列描述',
  PRIMARY KEY (pcyzdszmainid),
  UNIQUE INDEX UK_pcyzdszmain (tabname, colname)
)
ENGINE = INNODB
AVG_ROW_LENGTH = 1820
CHARACTER SET utf8
COLLATE utf8_general_ci
COMMENT = '常用字段值设置主表';


CREATE TABLE syjzhpt.pcyzdszdetail (
  pcyzdszmainid varchar(32) NOT NULL,
  pcyzdszdetailid varchar(32) NOT NULL DEFAULT '' COMMENT '常用字段值明细设置id',
  avalue varchar(5000) DEFAULT NULL COMMENT '值',
  aae140 varchar(10) DEFAULT NULL COMMENT '大类',
  czyxm varchar(20) DEFAULT NULL COMMENT '操作员姓名',
  czsj datetime DEFAULT NULL COMMENT '操作时间',
  PRIMARY KEY (pcyzdszdetailid),
  INDEX IDX_pcyzdszdetail_pcyzdszmainid (pcyzdszmainid)
)
ENGINE = INNODB
AVG_ROW_LENGTH = 1489
CHARACTER SET utf8
COLLATE utf8_general_ci
COMMENT = '常用字段值明细设置';





